import styles from "./card.module.css";
import LoadBtn from "../load-btn/load-btn";
import CardInfo from "./card-info";
import { slack } from "../cards/icons/slack.svg";
import { invision } from "../cardos/icons/in.svg";
import { notion } from "../cards/icons/notion.svg";
import { sketch } from "../cards/iconsskletch.svg";
import { studio } from "../cards/icons/stuio.svg";
import { figma } from "../cards/icons/figma.svg";
export default function Card() {
  return (
    <>
      <div className={styles.container}>
        <div className={styles.card}>
          <CardInfo
            logo={figma}
            header="Figma"
            subHeader="Free"
            info="Lorem, ipsum dolor sit amet consectetur adipisicing elit."
          />
        </div>

        <div className={styles.card}>
          <CardInfo
            logo={sketch}
            header="Sketch"
            subHeader="Trial & Paid"
            info="Lorem, ipsum dolor sit amet consectetur adipisicing elit."
          />
        </div>
        <div className={styles.card}>
          <CardInfo
            logo={studio}
            header="Visual Studio Code"
            subHeader="Free"
            info="Lorem, ipsum dolor sit amet consectetur adipisicing elit."
          />
        </div>

        <div className={styles.card}>
          <CardInfo
            logo={notion}
            header="Notion"
            subHeader="Free & Paid"
            info="Lorem, ipsum dolor sit amet consectetur adipisicing elit."
          />
        </div>
        <div className={styles.card}>
          <CardInfo
            logo={slack}
            header="Slack"
            subHeader="Free & Paid"
            info="Lorem, ipsum dolor sit amet consectetur adipisicing elit."
          />
        </div>

        <div className={styles.card}>
          <CardInfo
            logo={invision}
            header="Invision"
            subHeader="Free & Paid"
            info="Lorem, ipsum dolor sit amet consectetur adipisicing elit."
          />
        </div>
      </div>
      <LoadBtn />
    </>
  );
}
